import React from 'react'
import { Typography, TextField, Input } from '@material-ui/core';
function TextFieldComp(props) {
    return (
        <div style={{ display: 'flex', alignItems: 'center', marginBottom: '20px' }} >
            <Typography className={props.class} >{props.name}</Typography>
            <Input disabled={props.textFieldDisable} style={{
                paddingLeft: '20px',
                color: 'black'
            }} type={props.type ? props.type : 'text'}
                placeholder={props.placeholder} value={props.value} onChange={props.onChange} inputComponent={props.inputComponent ? props.inputComponent : 'input'} />
        </div>
    )
}

export default TextFieldComp
